CREATE TABLE EXEMPLAIRE
(
  NUMEXEMPLAIRE  INTEGER,
  NUMFILM        INTEGER,
  CODESUPPORT    VARCHAR2(4 BYTE),
  VO             VARCHAR2(16 BYTE),
  PROBLEME       VARCHAR2(60 BYTE),
  DETAILSUPPORT  VARCHAR2(8 BYTE)
)
TABLESPACE USERS
PCTUSED    0
PCTFREE    10
INITRANS   1
MAXTRANS   255
STORAGE    (
            INITIAL          792K
            MINEXTENTS       1
            MAXEXTENTS       2147483645
            PCTINCREASE      0
            BUFFER_POOL      DEFAULT
           )
LOGGING 
NOCACHE
NOPARALLEL
NOMONITORING;


ALTER TABLE EXEMPLAIRE ADD (
  PRIMARY KEY
 (NUMEXEMPLAIRE)
    USING INDEX 
    TABLESPACE USERS
    PCTFREE    10
    INITRANS   2
    MAXTRANS   255
    STORAGE    (
                INITIAL          424K
                MINEXTENTS       1
                MAXEXTENTS       2147483645
                PCTINCREASE      0
               ));


ALTER TABLE EXEMPLAIRE ADD (
  FOREIGN KEY (NUMFILM) 
 REFERENCES FILM (NUMFILM));


GRANT SELECT ON  EXEMPLAIRE TO ETU4_ROLE;

GRANT SELECT ON  EXEMPLAIRE TO PUBLIC WITH GRANT OPTION;
GRANT REFERENCES ON  EXEMPLAIRE TO PUBLIC;
SET DEFINE OFF;
